description:
Charging an electric vehicle has never been so convenient and easy to use!
Charge your electric car anywhere, choosing a location convenient for you! Trianon Energy is a service in which you do not put money on a deposit, but purchase the Kilowatts you need.
Together with the Trianon Energy application, you will have access to a large number of charging stations and additional options:
it is planned to install up to 200 charging stations;
pay for charging quickly and safely;
use charging station reservation;
View charging status notifications.
With our service, you no longer need to worry about where to charge your electric car - now charging stations are always nearby! In the personal history of the application, you will find information about previous transactions and the number of kilowatts purchased, and convenient filters on the map make finding a suitable electric filling station easy and fast.
We are constantly improving the application for simple and effective interaction with electric vehicle charging stations! We always welcome feedback from you!

*************

Зарядка электромобиля еще никогда не была такой удобной и простой в использовании!
Заряжайте свой электромобиль в любом месте, выбирая удобную для себя локацию! Trianon Energy — это сервис, в котором вы не кладете деньги на депозит, а приобретаете необходимые вам Киловатты.
Вместе с приложением Trianon Energy ﻿получите доступ к большому количеству зарядных станций, и дополнительных опций:
планируется установить до 200 зарядных станций;
﻿оплачивайте зарядку быстро и безопасно;
﻿используйте бронирование зарядной станции;
﻿﻿﻿просматривайте уведомления о статусе зарядки.
С нашим сервисом больше не нужно беспокоиться о том, где зарядить свой электромобиль - теперь зарядные станции всегда рядом! В личной истории приложения, вы найдете информацию о предыдущих транзакциях и количестве приобретенных киловатт, а удобные фильтры по карте делают поиск подходящей электрозаправки легким и быстрым.
Мы постоянно совершенствуем приложение для простого и эффективного взаимодействия с зарядными станциями для электромобилей! Мы всегда рады обратной связи от вас!

*************

Elektromobilni quvvatlantirish ilovasi bunchalik qulay va ishlatishda oson bo'lmagan!
O'zingizga qulay lokatsiyani tanlab, elektromobilingizni sizga yaqin joyda zaryadlang! Trianon Energy - bu ilovani ishlatish uchun depozit talab qiladigan ilova emas, balki o’zingizga kerakli kilovattlarni xarid qilib ularni istalgan paytda elektromobilingizga ishlatish uchun yaratilgan dasturdir.
Trianon Energy ilovasi bilan ko'plab zaryadlash stantsiyalaridan va qo'shimcha imkoniyatlardan foydalaning:
200 tagacha zaryadlash stansiyalarini o'rnatish rejalashtirilgan;
quvvatlantirishni tez va xavfsiz to'lang;
zaryadlash stantsiyasini navbatga bron qilish xizmatidan foydalaning;
zaryadlash holati to'g'risida xabarnomalarga ega bo’ling.
Bizning dasturimiz bilan endi elektromobilingizni qayerda zaryad qilish haqida tashvishlanishning hojati yo'q - endi quvvatlash stantsiyalari sizning yo’ningizda! Ilovaning shaxsiy tarixida siz avvalgi bajarilgan operatsiyalar va sotib olingan kilovattlar miqdori haqida ma'lumot topasiz hamda qulay filtrlar yo’rdamida siz o’zingizga yaqin bo’lgan quvvatlash moslamasini tez topishni oson qiladi.
Biz quvvatlash stantsiyalari bilan siz oson va samarali ishlashingiz uchun ilovani doimiy ravishda takomillashtirmoqdamiz! Biz har doim sizdan fikr-mulohaza olishdan xursand bo’lamiz!
